    <>
    <h1>{count}</h1>
    <button onClick={()=>{
        setcount(count+1);
    }}
    >increase</button>
    <button onClick={()=>{
        setcount(count-1);
    }}
    >decrease</button>
    </>
)
}
export default Counter;
